.footer {
  background: #111;
  padding: 40px 0;
  text-align: center;
  color: #fff;
}

.container {
  max-width: 900px;
  margin: auto;
}

.title {
  font-size: 20px;
  letter-spacing: 1px;
  margin-bottom: 10px;
  font-weight: 600;
}

.text {
  font-size: 13px;
  color: #ccc;
  margin-bottom: 20px;
}

.social {
  display: flex;
  justify-content: center;
  gap: 12px;
  margin-bottom: 20px;
}

.circle {
  width: 38px;
  height: 38px;
  background: #222;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 16px;
  color: #fff;
  transition: 0.3s;
  text-decoration: none !important;
}

.circle:hover {
  background: #28a745;
  transform: translateY(-4px);
}

.copy {
  font-size: 12px;
  color: #777;
  margin-top: 10px;
}
